import {React, useState} from "react"
import bookielogo from '../assets/bookielogo.png'
import './Menu.css'
import {Link} from 'react-router-dom';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function Menu() {
    const [isOpen, setIsOpen] = useState(false);
    return (
        <div className="header">
            <img src={bookielogo} alt="log" className="logo" />
            <button className="menu-toggle" onClick={() => setIsOpen(!isOpen)}>
                ☰
            </button>
            <ul className={`header_List ${isOpen ? "open" : ""}`}>
                <li><Link to="/Vasarlas">Vásárlás</Link></li>
                <li><Link to="/Eladas">Eladás</Link></li>
                <li><Link to="/Chat">Chat</Link></li>
                <li><Link to="/Profil">Profilom</Link></li>
            </ul>
        </div>
    );
}
export default Menu;
